
data = {
    "text": "hello ",
    "keyword": "hello"
}
import subprocess
import json

# Define the URL and the data to send
url = "http://192.168.49.2:31346/count-keywords"
# Convert the data dictionary to a JSON string
json_data = json.dumps(data)

# Construct the curl command with the POST method and JSON body
curl_command = [
    "curl",
    "-X", "POST",  # Use POST method
    "-H", "Content-Type: application/json",  # Set the content type to JSON
    "-d", json_data,  # Specify the data to send
    url  # The endpoint
]

count = 0 

while True:
    # Execute the command and capture the output
    result = subprocess.run(curl_command, capture_output=True, text=True)

    # Check the result
    if result.returncode == 0:
        print("Request successful.")
        print("Response:", result.stdout)
        count += 1
        print("Count: ", count)
    else:
        print("Request failed.")
        print("Error:", result.stderr)